import Head from "next/head";
import Allposts from "../components/Allposts.js";
import Header from "../components/Header.js";

export default function Home() {
  return (
    <div>
      <Head>
        <title>Create Next App</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
      <main>
        <Header />
        <Allposts />
      </main>
    </div>
  );
}
